import React, { useState } from 'react';

function LogsPage() {
  const [searchTerm, setSearchTerm] = useState("");
  const [level, setLevel] = useState("");
  const [date, setDate] = useState("");

  const logs = [
    { id: 1, time: "2025-02-11 09:15", ip: "192.168.1.15", level: "INFO", message: "Bağlantı Sağlandı" },
    { id: 2, time: "2025-02-11 09:17", ip: "10.0.0.25", level: "ERROR", message: "Erişim Reddedildi" }
  ];

  const handleFilter = () => {
    console.log("Filtre Uygula", { searchTerm, level, date });
  };
  const exportCSV = () => {
    console.log("CSV çıktı...");
  };
  const exportPDF = () => {
    console.log("PDF çıktı...");
  };

  return (
    <div>
      <h2 className="section-title mb-4">Log Yönetimi</h2>

      <div className="custom-card p-3 mb-3">
        <div className="row g-2">
          <div className="col">
            <input
              className="form-control"
              placeholder="Anahtar kelime"
              value={searchTerm}
              onChange={(e) => setSearchTerm(e.target.value)}
            />
          </div>
          <div className="col">
            <select
              className="form-select"
              value={level}
              onChange={(e) => setLevel(e.target.value)}
            >
              <option value="">Hepsi</option>
              <option value="INFO">INFO</option>
              <option value="WARN">WARN</option>
              <option value="ERROR">ERROR</option>
            </select>
          </div>
          <div className="col">
            <input
              type="text"
              className="form-control"
              placeholder="gg.aa.yyyy"
              value={date}
              onChange={(e) => setDate(e.target.value)}
            />
          </div>
          <div className="col-auto d-flex align-items-center">
            <button className="btn btn-accent me-2" onClick={handleFilter}>
              FİLTRE UYGULA
            </button>
            <button className="btn btn-outline-accent me-2" onClick={exportCSV}>CSV ÇIKIŞI</button>
            <button className="btn btn-outline-accent" onClick={exportPDF}>PDF ÇIKIŞI</button>
          </div>
        </div>
      </div>

      <div className="custom-card p-3">
        <table className="table table-dark table-bordered table-hover align-middle mb-0">
          <thead>
            <tr>
              <th>Tarih/Saat</th>
              <th>Kaynak IP</th>
              <th>Seviye</th>
              <th>Mesaj</th>
              <th>İşlem</th>
            </tr>
          </thead>
          <tbody>
            {logs.map(log => (
              <tr key={log.id}>
                <td>{log.time}</td>
                <td>{log.ip}</td>
                <td>{log.level}</td>
                <td>{log.message}</td>
                <td>
                  <button className="btn btn-sm btn-info">İNCELE</button>
                </td>
              </tr>
            ))}
          </tbody>
        </table>

        {/* Sayfalama */}
        <div className="d-flex justify-content-center mt-3">
          <button className="btn btn-secondary me-2">ÖNCEKİ</button>
          <div className="pt-2">Sayfa 1/5</div>
          <button className="btn btn-secondary ms-2">SONRAKİ</button>
        </div>
      </div>
    </div>
  );
}

export default LogsPage;
